import s from "./App.module.css";
import Nav from "./components/Nav/Nav";
import Footer from "./components/Footer/Footer";
import Profile from "./components/Main/Profile/Profile";
import Dialogs from "./components/Main/Dialogs/Dialogs";
import Burger from "./components/Nav/burger_menu/burger";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App(props) {
  let links = [
    {'href':'/Profile', 'name':'Profile'},
    {'href':'/Dialogs', 'name':'Dialogs'},
    {'href':'/Audio', 'name':'Audio'}];
  let logo = ['Logo'];
  return (
    <BrowserRouter>
      <div className={s.app_wrapper}>
        <Nav />
        <div className="item2">
          <Routes>
            <Route path="/" element={<Profile postData={props.postData} />} />
            <Route
              path="/Profile"
              element={<Profile postData={props.postData} />}
            />
            <Route
              path="/Dialogs"
              element={
                <Dialogs
                  MessageData={props.MessageData}
                  DialogsData={props.DialogsData}
                />
              }
            />
          </Routes>
        </div>
        <Footer />
      </div>
      <Burger items={links} logo ={logo}/>
    </BrowserRouter>
  );
}

export default App;
